import react from "react";
import './TicTacToe.css';

const board = [
    'x', null, 'o',
    'o', 'x', null,
    'x', 'o', null
];

const TicTacToe = () => {
    return <div className="tic-tac-toe">
        <h1>TicTacToe</h1>
    </div>
}

export default TicTacToe;
